        mHdltvinHandle << " , " <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"const_size_in_1_ap_vld\" :  \"" << const_size_in_1_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"const_size_out_1_ap_vld\" :  \"" << const_size_out_1_ap_vld.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"conv1d_input_V_data_0_V_TVALID\" :  \"" << conv1d_input_V_data_0_V_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"conv1d_input_V_data_0_V_TREADY\" :  \"" << conv1d_input_V_data_0_V_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"layer13_out_V_data_0_V_TVALID\" :  \"" << layer13_out_V_data_0_V_TVALID.read() << "\" ";
